import { makeStyles } from '@material-ui/core/styles';

export const useStyles = makeStyles(() => ({
    contactMeHeading: {
        marginTop: 32,
        fontWeight: 'bold'
    },
    headingStyle: {
        display: 'flex',
        alignItems: 'center',
        flexWrap: 'wrap',
        marginTop: 16
    },
    paragraphStyle: {
        fontSize: 22,
        marginTop: 4
    },
    iconStyle: {
        marginRight: 8,
        fontSize: 40,
        cursor: 'pointer'
    },
    boldText: {
        fontWeight: 'bold'
    },
    marginTopTwo: {
        marginTop: 2
    },
    marginTopEight: {
        marginTop: 8,
    },
    marginTopSixteen: {
        marginTop: 16
    },
    marginRightEight: {
        marginRight: 8
    }
}));
